import { useContext } from "react";
import Card from "../Components/Card";
import { Link } from "react-router-dom";
import { ContextGlobal, ThemeContext, themes } from "../Components/utils/global.context";


const Home = () => {
    const { theme } = useContext(ThemeContext);
    const themeClass = theme === themes.light ? 'light' : 'dark';
    const{datos} = useContext(ContextGlobal);

    return (
        <main className={`${themeClass}`}>
            <h1>Home</h1>
            <div className="card-grid">
                {datos.map((dato) => {
                    return ( 
                        <div className="card" key={dato.id}>
                            <Card
                                name={dato.name}
                                username={dato.username}
                                id={dato.id}
                            />
                            <Link to={`/detalle/${dato.id}`}>Ver detalle</Link>
                        </div>
                    );
                })}
            </div>
        </main>
    );
};

export default Home;
